function getCookie(name) {
  var matches = document.cookie.match(new RegExp(
    "(?:^|; )" + name.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g, '\\$1') + "=([^;]*)"
  ));
  return matches ? decodeURIComponent(matches[1]) : undefined;
}

dedlineHours = getCookie("dedlineHours");
dedlineMinutes = getCookie("dedlineMinutes");
dedlineSeconds = getCookie("dedlineSeconds");

hourX = 0; minuteX = 0; secX= 5;

if (!dedlineHours) {
    dateStart = new Date();

    dedlineHours = dateStart.getHours() + hourX;
    dedlineMinutes = dateStart.getMinutes() + minuteX;
    dedlineSeconds = dateStart.getSeconds() + secX + 1;
    document.cookie = "dedlineHours="+dedlineHours;
    document.cookie = "dedlineMinutes="+dedlineMinutes;
    document.cookie = "dedlineSeconds="+dedlineSeconds;

    delete dateStart;
}

//проверка, был ли отчет
var timerRun = false;

function CountBox() {
    dateNow = new Date();
    amount = ((dedlineHours - dateNow.getHours())*60*60 + (dedlineMinutes - dateNow.getMinutes())*60 + (dedlineSeconds - dateNow.getSeconds()))*1000;
    delete dateNow;
    if (amount < 0) {
        out = //"<span class='countbox-num'><span id='countbox-days1'><span></span>0</span><span id='countbox-days2'><span></span>0</span><span id='countbox-days-text'></span></span>" +
			// "<span class='countbox-space'></span>" +
			// "<span class='countbox-num'><span id='countbox-hours1'><span></span>0</span><span id='countbox-hours2'><span></span>0</span><span id='countbox-hours-text'></span></span>" +
			// "<span class='countbox-space'></span>" +
			"<span class='countbox-num'><span id='countbox-mins1'><span></span>0</span><span id='countbox-mins2'><span></span>0</span></span>" +
			"<span class='countbox-space'>:</span>" +
			"<span class='countbox-num'><span id='countbox-secs1'><span></span>0</span><span id='countbox-secs2'><span></span>0</span></span>";
        document.getElementById("countbox").innerHTML = out;
        setTimeout("CountBox()", 10000);
        if(timerRun) {
            upMessage.slideUp();
        }
    } else {
        timerRun = true;
        days = 0;
        days1 = 0;
        days2 = 0;
        hours = 0;
        hours1 = 0;
        hours2 = 0;
        mins = 0;
        mins1 = 0;
        mins2 = 0;
        secs = 0;
        secs1 = 0;
        secs2 = 0;
        out = "";
        amount = Math.floor(amount / 1e3);
        days = Math.floor(amount / 86400);
        days1 = (days >= 10) ? days.toString().charAt(0) : '0';
        days2 = (days >= 10) ? days.toString().charAt(1) : days.toString().charAt(0);
        amount = amount % 86400;
        hours = Math.floor(amount / 3600);
        hours1 = (hours >= 10) ? hours.toString().charAt(0) : '0';
        hours2 = (hours >= 10) ? hours.toString().charAt(1) : hours.toString().charAt(0);
        amount = amount % 3600;
        mins = Math.floor(amount / 60);
        mins1 = (mins >= 10) ? mins.toString().charAt(0) : '0';
        mins2 = (mins >= 10) ? mins.toString().charAt(1) : mins.toString().charAt(0);
        amount = amount % 60;
        secs = Math.floor(amount);
        secs1 = (secs >= 10) ? secs.toString().charAt(0) : '0';
        secs2 = (secs >= 10) ? secs.toString().charAt(1) : secs.toString().charAt(0);
        out = // "<span class='countbox-num'><span id='countbox-days1'><span></span>" + days1 + "</span><span id='countbox-days2'><span></span>" + days2 + "</span><span id='countbox-days-text'></span></span>" +
			//"<span class='countbox-space'></span>" +
			//"<span class='countbox-num'><span id='countbox-hours1'><span></span>" + hours1 + "</span><span id='countbox-hours2'><span></span>" + hours2 + "</span><span id='countbox-hours-text'></span></span>" +
			// "<span class='countbox-space'></span>" +
			"<span class='countbox-num'><span id='countbox-mins1'><span></span>" + mins1 + "</span><span id='countbox-mins2'><span></span>" + mins2 + "</span></span>" +
			"<span class='countbox-space'>:</span>" +
			"<span class='countbox-num'><span id='countbox-secs1'><span></span>" + secs1 + "</span><span id='countbox-secs2'><span></span>" + secs2 + "</span></span>";
        document.getElementById("countbox").innerHTML = out;
        setTimeout("CountBox()", 1e3)
    }
}

window.onload = function () {
    CountBox();
    if (timerRun) {
        upMessage.run();
    }
}

/*script*/
$(document).ready( function () {
	// alert(window.devicePixelRatio + ' ' + screen.width + ' ' + screen.height + ' ' + window.orientation);
	// alert(window.devicePixelRatio + ' ' + window.innerWidth + ' ' + window.innerHeight + ' ' + window.orientation);
});

//slider
$('.js-slider-2').each(function (idx, item) {
	var carouselId = "slider-" + idx;
	this.id = carouselId;

	if($(this).hasClass('js-slider-not-infinite')) {
		$(this).slick({
			slide: "#" + carouselId + " .js-slider-item",
			appendArrows: "#" + carouselId + " .js-slider-nav",
			prevArrow: '<button type="button" class="slider-nav__prev js-slider-prev">prev</button>',
			nextArrow: '<button type="button" class="slider-nav__next js-slider-next">next</button>',
			infinite: false,
			slidesToShow: 3,
			responsive: [
				{
					breakpoint: 768,
					settings: {
						slidesToShow: 1
					}
				},
				{
					breakpoint: 1280,
					settings: {
						slidesToShow: 2
					}
				}
			]
		});
		$("#" + carouselId + " .js-slider-nav").appendTo($(this));
		$(this).on('breakpoint', function(event, slick, breakpoint){
			$("#" + carouselId + " .js-slider-nav").appendTo($(this));
		});
	} else {
		$(this).slick({
			slide: "#" + carouselId + " .js-slider-item",
			appendArrows: "#" + carouselId + " .js-slider-nav",
			prevArrow: '<button type="button" class="slider-nav__prev js-slider-prev">prev</button>',
			nextArrow: '<button type="button" class="slider-nav__next js-slider-next">next</button>',
			infinite: true,
			slidesToShow: 3,
			responsive: [
				{
					breakpoint: 768,
					settings: {
						slidesToShow: 1
					}
				},
				{
					breakpoint: 1280,
					settings: {
						slidesToShow: 2
					}
				}
			]
		});
		$("#" + carouselId + " .js-slider-nav").appendTo($(this));
		$(this).on('breakpoint', function(event, slick, breakpoint){
			$("#" + carouselId + " .js-slider-nav").appendTo($(this));
		});
	}
});

//formstyler
$('.js-select select').styler();

//scrollbar
$('.jq-selectbox__dropdown ul').enscroll({
	verticalTrackClass: 'scrollbar__track',
	verticalHandleClass: 'scrollbar__handle',
	drawScrollButtons: true,
	scrollUpButtonClass: 'scrollbar__up',
	scrollDownButtonClass: 'scrollbar__down'
});

//inputmask
$(".js-tel").mask("+7(999)999-99-99");
$(".js-login-code").mask("9 9 9 9");

//close
$('.js-close').on('click', function () {
	$(this).parent().hide();
	if($(this).closest('.js-logo-cite').length) {
		$('body').removeClass('overflow-hidden');
	}
});

//js-slide-up
// $('.js-slide-up').on('click', function () {
// 	var $this = $(this);
// 	$this.parent()[0].style.marginTop = null;
// 	setTimeout(function() {
// 		$this.parent().hide();
// 	}, 1000);
// });

//js-up-message-close
var upMessage = {
	closer: $('.js-up-message-close'),
	upMessage: function() { return this.closer.parent(); },
	body: $('body'),
	bodyPadding: function() {
		this.body.addClass('padding');
	},
	slideUp: function() {
		var _this = this;
		this.upMessage()[0].style.marginTop = null;
		this.body.removeClass('padding');
		setTimeout(function() {
			_this.upMessage().hide();
		}, 1000);
	},
	slideDown: function() {
		this.upMessage().css('margin-top', 0);
	},
	run: function() {
		var _this = this;
		this.bodyPadding();
		this.slideDown();
		this.closer.on('click', function() {
			_this.slideUp();
		});
	}
};

//menu
$('.js-btn-menu')
	.on('click', function () {
		var $this = $('.js-menu');
		$('.js-block').not($this).hide();
		$this.toggle();
	})
	.hover(
		function() {
			$(this).addClass('hover');
			$(this).removeClass('blur');
		},
		function() {
			$(this).addClass('blur');
			$(this).removeClass('hover');
		}
	);


//city
$('.js-btn-city').on('click', function (e) {
	e.preventDefault();
	var $this = $('.js-city');
	$('.js-block').not($this).hide();
	$this.toggle();
});

//login
$('.js-btn-login').on('click', function (e) {
	e.preventDefault();
	var $this = $('.js-login');
	$('.js-block').not($this).hide();
	$this.toggle();
});

//cite
$('.js-logo').on('click', function (e) {
	$('.js-logo-cite').show();
	$('body').addClass('overflow-hidden');
});


//slider with repair places change
if($('.js-places-slider').length) {
	var sliderPlaces = $('.js-places-slider');
	sliderPlaces.slick({
		slide: ".js-places-slider .js-slider-item",
		appendArrows: ".js-places-slider .js-slider-nav",
		prevArrow: '<button type="button" class="slider-nav__prev js-slider-prev">prev</button>',
		nextArrow: '<button type="button" class="slider-nav__next js-slider-next">next</button>',
		slidesToShow: 1,
		autoplay: true
	});

	var sliderPlacesArray = ["в спортзале", "дома", "в офисе"];
	var sliderPlacesText = $('.js-places-text');

	sliderPlaces.on('afterChange', function(event, slick, currentSlide, nextSlide){
		var currentSlide = $('.js-places-slider .slick-current');

		if(currentSlide.hasClass('intro-slider__gym')) {
			sliderPlacesText.text(sliderPlacesArray[0]);
		} else
		if(currentSlide.hasClass('intro-slider__home')) {
			sliderPlacesText.text(sliderPlacesArray[1]);
		} else
		if(currentSlide.hasClass('intro-slider__office')) {
			sliderPlacesText.text(sliderPlacesArray[2]);
		}
	});
}

//prices slider
if($('.js-prices-slider').length) {
	var sliderPrices = $('.js-prices-slider');
	sliderPrices.slick({
		slide: ".js-prices-slider .js-slider-item",
		appendArrows: ".js-prices-slider .js-slider-nav",
		prevArrow: '<button type="button" class="slider-nav__prev js-slider-prev">prev</button>',
		nextArrow: '<button type="button" class="slider-nav__next js-slider-next">next</button>',
		asForNav: '.js-prices-nav',
		infinite: true,
		slidesToShow: 1
	});

	var pricesNavDot = $('.js-prices-nav a');
	pricesNavDot.on('click', function (e) {
		e.preventDefault();
		pricesNavDot.removeClass('active');
		$(this).addClass('active');
		sliderPrices.slick('slickGoTo', $(this).parent().index());
	});

	sliderPrices.on('afterChange', function(event, slick, currentSlide, nextSlide){
		var currentSlide = $('.js-prices-slider .slick-current');
		var defectInfoWrapper = $('.js-defect-info');

		if(currentSlide.hasClass('prices__watch')) {
			defectInfoWrapper.hide();
			pricesNavDot.removeClass('active');
			$(pricesNavDot[0]).addClass('active');
			$('.prices-device__watch').show();
		} else
		if(currentSlide.hasClass('prices__iphone')) {
			defectInfoWrapper.hide();
			pricesNavDot.removeClass('active');
			$(pricesNavDot[1]).addClass('active');
			$('.prices-device__iphone').show();
		} else
		if(currentSlide.hasClass('prices__ipad')) {
			defectInfoWrapper.hide();
			pricesNavDot.removeClass('active');
			$(pricesNavDot[2]).addClass('active');
			$('.prices-device__ipad').show();
		}
	});
}

//prices info
if($('.js-defect-points').length) {
	var defectPoint = $('.js-defect-points li');
	var defectInfo = $('.js-defect-info .two-columns');

	defectPoint.hover(
		function() {
			defectInfo.hide();
			$(defectInfo[$(this).index()]).show();
			$(defectInfo[$(this).index()]).children('p').show();
		},
		function() {
			defectInfo.show();
			$(defectInfo[$(this).index()]).children('p').hide();
		}
	);
}

